//全局弹窗
function buildNewAlertInHere() {
	var html = '<div class="apx-modal-business-alert modal fade business-management business_global_alert" tabindex="-1">\
			        <div class="modal-dialog modal-sm">\
			            <div class="modal-content">\
			                <div class="modal-header">\
			                    <a type="button" class="close" data-dismiss="modal">\
			                        <span aria-hidden="true">&times;</span>\
			                        <span class="sr-only">Close</span></a>\
			                    <h4 class="modal-title">提示信息</h4>\
			                </div>\
			                <div class="modal-body">\
			                    <div class="h4" style="padding: 20px 0;"><span class="alert_content"></span></div>\
			                </div>\
			                <div class="modal-footer">\
			                    <button type="button" class="btn btn-lg btn-business" data-dismiss="modal">确认</button>\
			                </div>\
			            </div>\
			        </div>\
			    </div>'
	$('body').append(html);
}
function showAlert(msg) {
	$('.business_global_alert .alert_content').html(msg);
	$('.business_global_alert').modal('show');
}
